// ThankYou.js

import React from 'react';
import './ThankYou.css'; // Import your CSS file

const ThankYou = () => {
  return (
    <div className="thank-you-container">
      <h2 className="thank-you-heading">Thank You!</h2>
      <p className="thank-you-paragraph">
        Your application has been received, one of our support agents will get back to you within the next 24-48 hours. Thank you for registering with Delta Communication Network.
      </p>
    </div>
  );
};

export default ThankYou;
